import Stat from './Stat';
import {useState} from "react"

export default function StatList({stats}) {
    const statList = stats.map((stat) => {
        return <Stat key = {stat.id} stat={stat} />
    });

    return (
        <>
            <ul className="quarter-page">{statList}</ul>
            </>
    );
}
